  RegisterRoute(request: RegisterRouteRequest): Promise<RoutePlan>;
  UpdateRoute(request: UpdateRouteRequest): Promise<RoutePlan>;
  UpdatePickupStatus(request: UpdatePickupRequest): Promise<Ack>;
  GetDriver(request: DriverId): Promise<DriverProfile>;
  GetDriverByUserId(request: UserId): Promise<DriverProfile>;
