export const DriverServiceServiceName = "lastmile.driver.DriverService";
export class DriverServiceClientImpl implements DriverService {
  private readonly rpc: Rpc;
  private readonly service: string;
  constructor(rpc: Rpc, opts?: { service?: string }) {
    this.service = opts?.service || DriverServiceServiceName;
    this.rpc = rpc;
    this.RegisterDriver = this.RegisterDriver.bind(this);
    this.RegisterRoute = this.RegisterRoute.bind(this);
    this.UpdateRoute = this.UpdateRoute.bind(this);
    this.UpdatePickupStatus = this.UpdatePickupStatus.bind(this);
    this.GetDriver = this.GetDriver.bind(this);
    this.GetDriverByUserId = this.GetDriverByUserId.bind(this);
  }
  RegisterDriver(request: RegisterDriverRequest): Promise<DriverProfile> {
    const data = RegisterDriverRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "RegisterDriver", data);
    return promise.then((data) => DriverProfile.decode(new BinaryReader(data)));
  }

  RegisterRoute(request: RegisterRouteRequest): Promise<RoutePlan> {
    const data = RegisterRouteRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "RegisterRoute", data);
    return promise.then((data) => RoutePlan.decode(new BinaryReader(data)));
  }

  UpdateRoute(request: UpdateRouteRequest): Promise<RoutePlan> {
    const data = UpdateRouteRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "UpdateRoute", data);
    return promise.then((data) => RoutePlan.decode(new BinaryReader(data)));
  }

  UpdatePickupStatus(request: UpdatePickupRequest): Promise<Ack> {
    const data = UpdatePickupRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "UpdatePickupStatus", data);
    return promise.then((data) => Ack.decode(new BinaryReader(data)));
  }

  GetDriver(request: DriverId): Promise<DriverProfile> {
    const data = DriverId.encode(request).finish();
    const promise = this.rpc.request(this.service, "GetDriver", data);
    return promise.then((data) => DriverProfile.decode(new BinaryReader(data)));
  }

  GetDriverByUserId(request: UserId): Promise<DriverProfile> {
    const data = UserId.encode(request).finish();
    const promise = this.rpc.request(this.service, "GetDriverByUserId", data);
    return promise.then((data) => DriverProfile.decode(new BinaryReader(data)));
  }
}

interface Rpc {
  request(service: string, method: string, data: Uint8Array): Promise<Uint8Array>;
}

type Builtin = Date | Function | Uint8Array | string | number | boolean | undefined;

export type DeepPartial<T> = T extends Builtin ? T
  : T extends globalThis.Array<infer U> ? globalThis.Array<DeepPartial<U>>
  : T extends ReadonlyArray<infer U> ? ReadonlyArray<DeepPartial<U>>
  : T extends {} ? { [K in keyof T]?: DeepPartial<T[K]> }
  : Partial<T>;

type KeysOfUnion<T> = T extends T ? keyof T : never;
export type Exact<P, I extends P> = P extends Builtin ? P
  : P & { [K in keyof P]: Exact<P[K], I[K]> } & { [K in Exclude<keyof I, KeysOfUnion<P>>]: never };

function toTimestamp(date: Date): Timestamp {
  const seconds = Math.trunc(date.getTime() / 1_000);
  const nanos = (date.getTime() % 1_000) * 1_000_000;
  return { seconds, nanos };
}

function fromTimestamp(t: Timestamp): Date {
  let millis = (t.seconds || 0) * 1_000;
  millis += (t.nanos || 0) / 1_000_000;
  return new globalThis.Date(millis);
}

function fromJsonTimestamp(o: any): Date {
  if (o instanceof globalThis.Date) {
    return o;
  } else if (typeof o === "string") {
    return new globalThis.Date(o);
  } else {
    return fromTimestamp(Timestamp.fromJSON(o));
  }
}

function isSet(value: any): boolean {
  return value !== null && value !== undefined;
}

export interface MessageFns<T> {
  encode(message: T, writer?: BinaryWriter): BinaryWriter;
  decode(input: BinaryReader | Uint8Array, length?: number): T;
  fromJSON(object: any): T;
  toJSON(message: T): unknown;
  create<I extends Exact<DeepPartial<T>, I>>(base?: I): T;
  fromPartial<I extends Exact<DeepPartial<T>, I>>(object: I): T;
}
